      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:007534412033:function:Udacity_1:$LATEST"
      },
      "Next": "Lambda Invoke (udacity_2)"
    },
    "Lambda Invoke (udacity_2)": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:007534412033:function:Udacity_2:$LATEST"
      },
      "Next": "Lambda Invoke (udacity_3)"
    },
    "Lambda Invoke (udacity_3)": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:007534412033:function:Udacity:$LATEST"
      },
      "End": true
    }
  }
}
